import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { HeaderComponent } from './components/masterPage/header/header.component';
import { FooterComponent } from './components/masterPage/footer/footer.component';
import { UsersComponetComponent } from './components/User/users-componet/users-componet.component';
import { UserComponetComponent } from './components/User/user-componet/user-componet.component';
import { LoginComponentComponent } from './components/User/login-component/login-component.component';


@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    UsersComponetComponent,
    UserComponetComponent,
    LoginComponentComponent
  ],
  imports: [
    BrowserModule,
    FormsModule,
    AppRoutingModule,
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
